        {/* ENTRIE THREE */}
        <motion.div
          transition={{ duration: 0.8 }}
          initial={{ opacity: 0, transform: "translateY(-40px)" }}
          whileInView={{ opacity: 1, transform: "translateY(0)" }}
          viewport={{ once: true }}
        >
          <div
            className="BlogEntrie"
            onClick={() => {
              window.location.href = "/PersonalSite/#/post1";
            }}
          >
            <p>
              <a title="blog">
                Blog
              </a>
            </p>
